import React from 'react';
import Comp2 from './Comp2'

function Comp1(props) {
    return (
        <div>
            <div className='data'>
                <h1> title = {props.title1} </h1>
                <p>description = {props.description1} </p> 

                <Comp2 title = 'title2'/>
                <Comp2 description2 = 'description2'/>
            </div>
        </div>        
    )
}

export default Comp1
